import React, { Component } from 'react';

class ListEmployeeComponents extends Component {
    render() {
        return (
            <div>
                <div className="content-wrapper">
                    {/* Content Header (Page header) */}
                    <div className="content-header">
                        <div className="container-fluid">
                            <div className="row mb-2">
                                <div className="col-sm-6">
                                    <h1 className="m-0 text-dark">Dashboard v2</h1>
                                </div>{/* /.col */}
                                <div className="col-sm-6">
                                    <ol className="breadcrumb float-sm-right">
                                        <li className="breadcrumb-item"><a href="#">Home</a></li>
                                        <li className="breadcrumb-item active">Dashboard v2</li>
                                    </ol>


                                </div>{/* /.col */}
                            </div>{/* /.row */}
                        </div>{/* /.container-fluid */}
                    </div>

                    <section className="content">
                        <div className="container-fluid">
                            {/* Info boxes */}




                            <div className="row">
                                <div className="col-md-12">
                                    <div className="card">
                                        {/* <div className="card-header">
                                            <h5 className="card-title">Monthly Recap Report</h5>
                                            <div className="card-tools">
                                                <button type="button" className="btn btn-tool" data-card-widget="collapse">
                                                    <i className="fas fa-minus" />
                                                </button>
                                                <div className="btn-group">
                                                    <button type="button" className="btn btn-tool dropdown-toggle" data-toggle="dropdown">
                                                        <i className="fas fa-wrench" />
                                                    </button>
                                                    <div className="dropdown-menu dropdown-menu-right" role="menu">
                                                        <a href="#" className="dropdown-item">Action</a>
                                                        <a href="#" className="dropdown-item">Another action</a>
                                                        <a href="#" className="dropdown-item">Something else here</a>
                                                        <a className="dropdown-divider" />
                                                        <a href="#" className="dropdown-item">Separated link</a>
                                                    </div>
                                                </div>
                                                <button type="button" className="btn btn-tool" data-card-widget="remove">
                                                    <i className="fas fa-times" />
                                                </button>
                                            </div>
                                        </div> */}
                                        {/* /.card-header */}
                                        <div className="card-body">
                                            <div className="row">
                                                
                                             
                                                {/* /.col */}
                                            </div>
                                            {/* /.row */}
                                        </div>
                                        {/* ./card-body */}
                                    
                                        {/* /.card-footer */}
                                    </div>
                                    {/* /.card */}
                                </div>
                                {/* /.col */}
                            </div>


                            <div className="row">
                                <h2 className="text-center">Employye list</h2>
                            </div>
                        </div>
                    </section>
                </div>

            </div>
        );
    }
}

export default ListEmployeeComponents;
